            insert_into_tree(tree, {'_text': line[:-1]}, level=1)
            level = 2
            while line.startswith('<', level):
                level += 1
            insert_into_tree(tree, line, level=level)
        else:
            insert_into_tree(tree, {'_text': line}, level=1)
    return max(len(tree) for tree in tree.values())

